import React from 'react';
import UserRegistration from './components/UserRegistration';
import './App.css';

function App() {
    return (
        <div className="container-fluid">
        <nav>
        <div className="nav-wrapper center-align">User Registration</div>
        <a href="/" className="brand-logo"></a>
        </nav>
        <div className="row">
        <UserRegistration/>
        </div>
        </div>
);
}

export default App;
